import React from 'react'
import "./topbar.css"

const TopBar = () => {
  return (
    <div className='top'>
        <div className='topLeft'>l</div>
        <div className='topCenter'>c</div>
        <div className='topRight'>r</div>
    </div>
  )
}

export default TopBar
